/*
 * This hack allows to edit kittens game save export.
 *
 * It worked for me.  If it doesn't work for you, I probably won't have time to
 * fix  it,  however  someone  else  may  so  you  can  leave  questions on the
 * repository.
 * And in the words of great Ron Swanson,
 *     "Give a man a fish and you feed him for a day.
 *      Don’t teach a man to fish and you feed yourself.
 *      He’s a grown man; fishing’s not that hard."
 * So try to fix it yourself, then drop a fix here or in your fork or whatever.
 * The  parts  of code  that  load  the file are taken verbatim for LZString or
 * simplified for the rest
 * from https://bitbucket.org/bloodrizer/kitten-game/src/master/game.js. Mind
 * the gap and all implied licenses.
 *
 * How to use?
 * 1. Export  data  from your kittens game - copy the long  jibberish string to
 *    a text file. Use an editor that won't mash up your text by replacing text
 *    with emojis or inserting blank lines. Vim is fine, emacs obviously not ;)
 *    Don't use MS Word, on Windows just use Notepad.
 * 2. Copy  this  file.  Replace  my  jibberish  in  encrypted_data  with your.
 *    See img/empty_page.png
 * 3. Open an empty tab in Chrome,  select  "inspect" option from context menu.
 * 4. Execute the script.  You can follow the lines and hopefully  it's obvious
 *    from comments which lines are needed and which ones you may skip. You may
 *    want  to add  any other processing you'd like.  But before the last lines
 *    that produce output...
 * 5. Examine the resulting data.  In Google Chrome,  if you followed the steps
 *    above, you may just enter
 *      data
 *    at the prompt line.  Chrome should show you  expandable tree for the JSON
 *    structure.  You can  inspect the whole save  and modify manually anything
 *    that was not cover by my or your script.
 *    See img\editable_save_tree_view.png
 * 6. Run the last  lines  that  produce the output.  The new  jibberish should
 *    appear  as contents  of the page  you're inspecting.  Just coppy that and
 *    move import it into your kittens game.
 *    See img/script_executed.png
 */

