// Decompression helper, also needed.
var decompressLZData = function(lzData) {
  return lzData.slice(0, 16) == "N4IgzghgbgpgajAT"
    ? LZString.decompressFromBase64(lzData)
    : LZString.decompressFromUTF16(lzData);
};

// Compression helper, also needed.
var compressLZData = function(json, useBase64) {
  //todo check game compatibility flags
  //console.log("base64 length:", LZString.compressToBase64(json).length, "utf-16 length:", LZString.compressToUTF16(json).length);
  return useBase64
  ? LZString.compressToBase64(json)
  : LZString.compressToUTF16(json);
};

// This is  the main  function  used  to change the JSON save game structure in
// browser memory to the jibberish that kittens game use for  import or export.
var saveExport = function(data){
  return compressLZData(JSON.stringify(data),
			true /*base64*/);
};

// This is the main function used to change the jibberish that kittens game use
// for  import or export  into  the JSON  save  game  structure  in the browser
// memory.
var importData = function(datastr) {
  return JSON.parse(decompressLZData(datastr));
};

// That's  a game  save data  I produced  once.  True story.  Lot's of kittens.
var encrypted_data = '';

// A helper  to  quickly  run  max  function.  Mind  the NaNs  -  treat  as  0.
var sn = function (num) { if (Number.isNaN(num)) { return 0; } return num; }
var max = function(a, b) {
  return Math.max(sn(a), sn(b));
}

// Load the obfuscated data into 'data' variable.
var data = importData(encrypted_data);

// Unlock all the hats achievements.
var hats = data.ach.hats;
for (i in hats) { hats[i].unlocked = true; }

// Unlock all the achievements.
var ach = data.achievements;
for (i in ach) { ach[i].unlocked = true; ach[i].starUnlocked = true; }

// Unlock all the buildings.  Give  100 times more buildings than the number in
// the save game. If none, give 100.
// Load all buildings -- this is used here and in the max kittens correction later.
var bs = data.buildings;
for (i in bs) {
  bs[i].unlocked = true;
  bs[i].val = 100 * max(1, bs[i].val);
  bs[i].on = bs[i].val;
}

// Unlock and grant all achievements.
var cs = data.challenges.challenges;
for (i in cs) { cs[i].unlocked = true; cs[i].researched = true; }

// Unlock all races in Trade diplomacy.
var rc = data.diplomacy.races;
for (i in rc) { rc[i].unlocked = true; } // leviathans!!! <3 :3

// Unlock and grant all perks.
var perks = data.prestige.perks;
for (i in perks) { perks[i].unlocked = true; perks[i].researched = true; }

// Unlock  all aspects of religion.  Grant 10 or 20  of everything, because why
// the f not.
var rru = data.religion.ru;
for (i in rru) { rru[i].val = 10; rru[i].on = 10; }
var rtu = data.religion.tu;
for (i in rtu) { rtu[i].unlocked = true; }
var rzu = data.religion.zu;
for (i in rzu) { rzu[i].unlocked = true; rzu[i].val=20; rzu[i].on=20; }

// Cornucopia!  Give 1000 time  the resources  from original save,  or at least
// 1000 each.
var res = data.resources;
for (i in res) {
  res[i].value = Math.max(1000, res[i].value);
  res[i].unlocked = true;
  res[i].isHidden = false;
}

// Unlock and marked as research all sciences.
var sci = data.science.techs;
for (i in sci) { sci[i].unlocked = true; sci[i].researched = true; }

// Reach  all  the possible planets.  Unlock and build  100 times  the original
// number, or at least 100, of any building on any planet.
// Load all planets -- this is used here and in the max kittens correction later.
var plan = data.space.planets;
for (i in plan) {
  var p = plan[i];
  p.reached = true;
  p.routeDays = 0;
  p.unlocked = true;
  var bs = p.buildings;
  for (bsi in bs) {
    bs[bsi].unlocked = true;
    bs[bsi].val = 100 * Math.max(1, bs[bsi].val);
    bs[bsi].on = bs[bsi].val;
  }
}

// Basically, that never happened. Right? Right!
var st = data.stats;
for (i in st) { if (st[i].name == 'kittensDead') { st[i].val = 0; } }

// All time wibbly wobbly, timey wimey stuff.
var tcfu = data.time.cfu;
for (i in tcfu) {
  tcfu[i].unlocked = true;
  tcfu[i].val = 100 * max(1, tcfu[i].val);
  tcfu[i].on = tcfu[i].val;
}
var tvsu = data.time.vsu;
for (i in tvsu) {
  tvsu[i].on = tvsu[i].val = max(tvsu[i].val, 1);
}

// Unlock all the crafts.
var cr = data.workshop.crafts;
for (i in cr) { cr[i].unlocked = true; }

// Grant all the upgrades.
var up = data.workshop.upgrades;
for (i in up) { up[i].unlocked = true; up[i].researched = true; }

// That's a long winded way of get a number from a list...
// Ah, the weekends :3
var val = function(arr, filter_prop, val_prop) {
  return function(el) {
    for (i in arr) {
      if (arr[i][filter_prop] == el) {
        return arr[i][val_prop];
      }
    }
    return NaN;
  }
}
// Now,  we can define  a function that will load the value of the building for
// any building name.  Sum up all the buildings, including all the exoplanetary
// ones.
var all_buildings = [];
all_buildings.concat(data.buildings);
for (i in plan) {
  all_buildings=all_buildings.concat(plan[i].buildings);
}
// "How many buildings (of the kind...)"
var hmb = val(all_buildings, 'name', 'val');

// Not sure  if skipping this breaks the save.  Just reset  max_kittens to what
// capacity was "built" up.
var max_kittens = 2 * hmb('hut') + hmb('logHouse') + hmb('mansion') + 2 * hmb('spaceStation') + hmb('terraformingStation');
data.village.maxKittens = max_kittens;

// Basically, clean up the page and prepare one span element to contain the unbroken output text.
document.body.innerHTML = '';
var output = document.createElement('span');

// "Print"  the export data into  the output span element  and attach it to the
// page. Voilà!
output.innerText = saveExport(data);
document.body.appendChild(output);

// And,  to make sure that this jibberish is kind of OK...  load it to variable
// and eyeball it.
var verify = importData(output.innerText);
verify;
